import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
const Attendance = () => {
  const navigate = useNavigate();
  useEffect(() => {

    if(!localStorage.getItem("token"))
    {
      navigate('/')
    }
  }, [])
  return (
    <>
      <div className='text-center py-10'>
        <h1 className='text-3xl italic font-serif'>Attendance Page</h1>
        <h1 className='text-lg italic font-mono mt-10'>Welcome user</h1>
        <button className='w-[5%] border-2 bg-red-500 text-'>Logout</button>
      </div>
    </>
  )
}

export default Attendance
